import React from 'react';

const Input = ({ label, value, onChange }) => {
  const inputStyle = {
    marginLeft: '10px',
    padding: '5px 10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
  };

  const labelStyle = {
    marginRight: '10px',
    fontWeight: 'bold',
  };

  return (
    <div style={{ display: 'inline-block', marginRight: '15px' }}>
      <label style={labelStyle}>{label}:</label>
      <input
        type="number"
        value={value}
        onChange={onChange}
        style={inputStyle}
        min="1"
      />
    </div>
  );
};

export default Input;
